(8, 3, 'kjgkg', 1, '2020-06-10', 'mbmb', 'hgfj', 1, '2020-06-10 04:09:01', '2020-06-10 04:09:01'),
(21, 4, 'Alur training untuk teknisi yang baru masuk / magang / kontrak', 5, '2020-06-15', '-', 'Membuat alur yang baru mengenai jalur training untuk teknisi yang baru masuk. Teknisi yang baru masuk belum mempunyai area / wilayah / HD Center dan belum di tetapkan siapa penanggung jawabnya (KA Teknisi)', 1, '2020-06-11 09:19:56', '2020-06-11 09:19:56'),
(22, 4, 'Lama waktu untuk teknisi baru di training', 5, '2020-06-15', '-', 'Magang dilakukan selama 3 bulan, dengan rincian 1 bulan pertama dilakukan teori full di kantor dan 2 bulan berikutnya dilakukan praktek di lapangan + teori (ikut kunjungan dengan teknisi), kemudian Ka Teknisi & Tech Support melakukan evaluasi internal setiap bulan dan di laporkan kepada KA TAM', 1, '2020-06-11 09:19:56', '2020-06-11 09:19:56'),
(23, 4, 'Rekomendasi untuk penempatan teknisi baru', 5, '2020-06-15', '-', 'Setelah setiap bulan dilakukan evaluasi internal, maka pada bulan ketiga akan di lakukan evaluasi terakhir.  Rekomendasi dikeluarkan jika sudah sesuai kriteria atau tetap training / magang jika tidak sesuai kriteria yang ditetapkan.', 1, '2020-06-11 09:19:56', '2020-06-11 09:19:56'),
(24, 4, 'Alur untuk penempatan wilayah', 5, '2020-06-15', '-', 'Jika sudah dikeluarkan Rekomendasi, maka KA TAM akan menunjuk KA Teknisi yang akan bertanggung jawab atas teknisi tsb. Selanjutnya KA Teknisi akan menempatkan area / wilayah / HD Center untuk teknisi tsb', 1, '2020-06-11 09:19:56', '2020-06-11 09:19:56'),
(25, 4, 'Proses untuk teknisi yang baru masuk / magang / kontrak', 5, '2020-06-15', '-', 'Akan diberlakukan panel untuk evaluasi teknisi baru yaitu sesi tanya jawab dan presentasi mengenai mesin RO, mesin HD, skema jalur RO antara KA Teknisi, Tech Support dan KA TAM', 1, '2020-06-11 09:19:56', '2020-06-11 09:19:56'),
(26, 4, 'Ketetapan penempatan untuk teknisi an Edy', 5, '2020-06-15', '-', 'Teknisi baru an Edy akan di evaluasi setiap minggu oleh KA Teknisi dan dilaporkan ke KA TAM Area. Teknisi tsb akan ditempatkan di Area Madura pada bulan Juli 2020', 1, '2020-06-11 09:19:56', '2020-06-11 09:19:56'),
(35, 5, 'SOP / WI mengenai alur penerimaan dan training teknisi baru / magang', 5, '2020-06-15', '-', 'Membuat SOP atau WI mengenai alur / jalur tentang penerimaan dan training untuk teknisi magang', 1, '2020-06-12 03:10:12', '2020-06-12 03:10:12'),
(36, 5, 'Tata Cara Backwash Manual pada RO', 5, '2020-06-15', '-', 'Penyamaan persepsi untuk tata cara backwash manual pada mesin RO, agar teknisi menjalankan sesuai dengan protap agar tidak salah', 1, '2020-06-12 03:10:12', '2020-06-12 03:10:12'),
(37, 5, 'Rasio jumlah teknisi saat instalasi', 5, '2020-06-15', '-', 'Team Tech Support membuat regulasi mengenai rasio jumlah teknisi saat melakukan instalasi mesin RO baru', 1, '2020-06-12 03:10:12', '2020-06-12 03:10:12'),
(38, 5, 'Penempatan teknisi station Mojokerto', 5, '2020-07-01', '-', 'Teknisi an Tiara Yoga Adi Kurniawan akan ditempatkan di Station Mojokerto pada Bulan Awal Juli 2020', 1, '2020-06-12 03:10:12', '2020-06-12 03:10:12'),
(39, 5, 'Areal untuk teknisi an Wahyudi', 5, '2020-07-01', '-', 'Wahyudi memegang area secara tendem pada bulan Juni dan akan full memegang area pada bulan Juli 2020 menggantikan Yoga', 1, '2020-06-12 03:10:12', '2020-06-12 03:10:12'),
(40, 5, 'Penempatan teknisi station Madura', 5, '2020-07-01', '-', 'Teknisi an Edy akan ditempatkan di Station Madura pada Bulan Juli 2020. Rekomendasi dikeluarkan oleh KA Teknisi dan dilaporkan ke KA TAM', 1, '2020-06-12 03:10:12', '2020-06-12 03:10:12'),
(41, 5, 'Pengajuan gulung dinamo pompa', 5, '2020-06-15', '-', 'Pengajuan gulung dinamo pompa segera diajukan setelah POB diterima oleh admin (pengajuan tidak ditumpuk). Pompa di repair secara utuh (pompa dikirim utuh ke bengkel untuk di reparasi). Pompa yang sudah ada di tech support segera di data dan dibuatkan POB oleh tech support kemudian di serahkan ke admin untuk di ajukan ke pusat, agar segera bisa diperbaiki', 1, '2020-06-12 03:10:12', '2020-06-12 03:10:12'),
(42, 5, 'Form Instalasi Fixed Asset RS', 5, '2020-07-15', '-', 'Form diisi oleh teknisi dan di ttd oleh KA Ruangan kemudian form dikembalikan pada DCQA untuk di pulling. Form mulai dilaksanakan / diedarkan pada tanggal 11 Juni 2020', 1, '2020-06-12 03:10:12', '2020-06-12 03:10:12'),
(64, 7, 'Buat WI sesuai alur penerimaan tenaga teknisi', 5, '2020-06-19', '-', 'WI dibuatkan sesuai dengan skema / alur penerimaan tenaga teknisi dan dijelaskan per point', 1, '2020-06-16 02:19:29', '2020-06-16 02:19:29'),
(65, 7, 'Kerjasama dengan bengkel pompa untuk repair pompa secara utuh', 5, '2020-06-19', '-', 'Hubungi bengkel pompa untuk kerjasama. agar terealisasi perbaikan pompa secara utuh dan bengkel bisa memunculkan penawaran harga sesuai dengan kerusakan pada pompa tsb', 1, '2020-06-16 02:19:29', '2020-06-16 02:19:29'),
(66, 7, 'Admin untuk team Technical Support', 5, '2020-06-16', '-', 'Penunjukan admin sementara untuk team Technical Supprt adalah Hazyiyah', 2, '2020-06-16 02:19:29', '2020-06-16 02:19:29'),
(67, 7, 'Reminder form rekomendasi untuk teknisi Mojokerto', 5, '2020-07-01', '-', 'Reminder untuk KA Teknisi agar mempersiapkan form rekomendasi untuk Yoga', 2, '2020-06-16 02:19:29', '2020-06-16 02:19:29'),
(68, 7, 'Stok opname toolkit agar dijalankan', 5, '2020-07-01', '-', 'KA Teknisi agar mulai menjalankan stok opname alat kerja teknisi / toolkit setiap akhir bulan, mulai dari akhir bulan Juni 2020', 1, '2020-06-16 02:19:29', '2020-06-16 02:19:29'),
(69, 7, 'Persiapan review untuk teknisi Yoga sebelum di pindah station', 5, '2020-06-23', '-', 'Yoga akan di review secara panel oleh KA TAM, KA Teknisi & Technical Support pada tanggal 23 Juni 2020', 1, '2020-06-16 02:19:29', '2020-06-16 02:19:29'),
(88, 9, 'Alur penerimaan teknisi baru', 5, '2020-06-22', '-', 'Alur penerimaan di perjelas dengan plot-plot setiap KA Teknisi dan bentuk panel yang di inginkan. Materi training di perjelas pada KA Teknisi & Tech Supoort. Cakupan materi / teori diperbaiki. Deadline Senin, 22 Juni 2020', 1, '2020-06-19 02:38:41', '2020-06-19 02:38:41'),
(89, 9, 'Data pompa dan simulasi water treatment', 5, '2020-06-22', '-', 'Data pompa dari Tech Support segera di buat. Simulasi untuk water treatment di Workshop segera di laksanakan dan dilengkapi. Deadline Rabu, 24 Juni 2020', 1, '2020-06-19 02:38:41', '2020-06-19 02:38:41'),
(90, 9, 'Kerjasama dengan bengkel pompa', 5, '2020-06-22', '-', 'Bengkel pompa setuju untuk melakukan kerjasama dengan Sinar Roda Utama dengan pembayaran di akhir. Pompa dari teknisi ada histori kerusakan dan dilaporkan ke KA Teknisi, kemudian Tech Supoort melakukan analisa singkat tanpa membongkar pompa, pompa di antra ke bengkel untuk dilakukan analisa menyeluruh dan perbaikan', 1, '2020-06-19 02:38:41', '2020-06-19 02:38:41'),
(91, 9, 'Melakukan pendataan pada pompa', 5, '2020-06-19', '-', 'Pompa akan di data dan dilakukan drit untuk no seri pada pompa tsb, sehingga meminimalisir pompa tertukar', 1, '2020-06-19 02:38:41', '2020-06-19 02:38:41'),
(92, 9, 'Ada part yang dikanibal di RSUD Dr Soedono', 5, '2020-06-19', '-', 'POB diserahkan hari ini ke admin part, kanibal di lakukan karena urgent', 2, '2020-06-19 02:38:41', '2020-06-19 02:38:41'),
(93, 9, 'Perapihan ruang workshop', 5, '2020-06-19', '-', 'Ruang workshop segera dibersihkan dan dirapikan karena akan datang mesin Surdial yang cukup banyak', 1, '2020-06-19 02:38:41', '2020-06-19 02:38:41'),
(94, 9, 'Bantu untuk FU ke pusat mengenai sparepart yang belum dateng', 5, '2020-06-19', '-', 'Pak Gatot akan bantu FU ke SCM Pusat untuk part yang belum datang ke Surabaya', 1, '2020-06-19 02:38:41', '2020-06-19 02:38:41'),
(95, 9, 'FU ke bagian Pengadaan untuk permintaan TDS Meter teknisi', 5, '2020-06-22', '-', 'Membuat permintaan pembelian TDS Meter ke bagian Pengadaan untuk semua teknisi Area JATIM', 1, '2020-06-19 02:38:41', '2020-06-19 02:38:41'),
(96, 9, 'Foto saat supervisi (Ruang RO & HD)', 5, '2020-06-22', '-', 'Ka Teknisi setiap melakukan supervisi ke Area harus melampirkan foto pada saat laporan. Foto-foto tsb di buat slide show kemudian dibahas bersama untuk  perbaikan kedepannya', 1, '2020-06-19 02:38:41', '2020-06-19 02:38:41'),
(97, 10, 'Perapihan ruang workshop', 5, '2020-06-29', 'Sudah di lakukan perpihan', 'Mesin-mesin di bagi secara zone yaitu Sudah di cek, Baru datang & Akan di cek', 2, '2020-06-22 02:41:58', '2020-06-22 02:41:58'),
(98, 10, 'Alur penerimaan teknisi baru', 5, '2020-06-22', 'Ketentuan Standar Teknisi Baru dan draft modul pelatihan sudah dibuat', 'Draft modul akan di sederhanakan bahasanya', 2, '2020-06-22 02:41:58', '2020-06-22 02:41:58'),
(99, 10, 'Zonasi mulai diberlakukan', 5, '2020-06-29', '-', 'Zonasi mulai diberlakukan untuk meminimalisir hasil cek lab yang jelek dan material / bahan pendukung akan di komunikasikan dengan Pusat agar tidak ada keterlambatan pengiriman', 1, '2020-06-22 02:41:59', '2020-06-22 02:41:59'),
(100, 10, 'Perapihan modul pelatihan teknisi baru', 5, '2020-07-20', '-', 'Membuat modul pelatihan baru sesuai dengan draft modul yang telah dibuat dan disepakati bersama', 1, '2020-06-22 02:41:59', '2020-06-22 02:41:59'),
(101, 10, 'FU ke bagian Pengadaan untuk permintaan TDS Meter teknisi', 5, '2020-06-29', 'Sudah ada TDS meter sebanyak 2 unit di Bagian Pengadaan', 'Sudah dibuatkan permintaan untuk pembelian TDS meter sebanyak 21 unit dan sudah di ACC oleh Pak Herman', 1, '2020-06-22 02:41:59', '2020-06-22 02:41:59'),
(102, 10, 'Laporan KA Teknisi Okta Wirawan', 5, '2020-06-22', '-', 'Area Jember tidak ada masalah. Masalah listrik untuk menggunakan Hot Citric (listrik tidak mencukupi) di RS Universitas Muhammadiyah Malang  slow respon sehingga KA Teknisi minta Kantor untuk bersurat ke RS', 1, '2020-06-22 02:41:59', '2020-06-22 02:41:59'),
