(104, 10, 'Simulasi water treatment', 5, '2020-06-24', '-', 'Deadline pada Rabu, 24 Juni 2020', 1, '2020-06-22 02:41:59', '2020-06-22 02:41:59'),
(105, 10, 'Ketentuan jarak luar kota dan bensin Rp 10.000', 5, '2020-06-29', '-', 'Untuk dibuatkan ketentuan mengenai jarak luar kota atau untuk mendapatkan bensin Rp 10.000 dan minta untuk di tambah mengenai bensin yaitu menjadi Rp 20.000', 1, '2020-06-22 02:41:59', '2020-06-22 02:41:59'),
(106, 10, 'Sparepart yang sudah di jadikan Surat Jalan', 5, '2020-06-26', '-', 'Sparepart yang sudah jadi SJ akan dikirim oleh bagian delivery, teknisi boleh mengambil sparepart jika part tersebut benar-benar urgent', 1, '2020-06-22 02:41:59', '2020-06-22 02:41:59'),
