(1480, 57, 'Evaluasi mingguan KA Teknisi Heru Darmawan', 5, '2020-07-20', '-', 'FU ke RSI Jemursari untuk hasil cek lab air baku. Kalibrasi mesin HD di area Situbondo & Bondowoso dilaksanakan besok tanggal 21 Juli 2020, bersamaan dengan instalasi ruang covid-19 di RS Elizabeth', 1, '2020-07-20 03:33:33', '2020-07-20 03:33:33'),
(1481, 57, 'Evaluasi mingguan KA Teknisi Okta Wirawan', 5, '2020-07-20', '-', 'Kupang minta membrane & akan segera dikirim ke Kupang. RSUD Jombnag akan kalibrasi dengan BPFK minggu depan & akna di dampingi oleh teknisi station. RS Lavalette banyak kekurangan pada part lokal yang datang dari pusat.', 1, '2020-07-20 03:33:33', '2020-07-20 03:33:33'),
(1482, 57, 'Survey sebelum di lakukan instalasi mesin RO', 5, '2020-07-20', '-', 'Survey dilakukan sebelum instalasi di RS & membuat BQ-WT part lokal yang sekiranya akan di butuhkan saat instalasi mesin RO', 1, '2020-07-20 03:33:33', '2020-07-20 03:33:33'),
(1483, 57, 'Peralihan job dari teknisi ke TS', 5, '2020-07-20', '-', 'List pekerjaan yang dialihtugaskan sbb :\r\n\r\n1. Instalasi mesin HD-RO\r\n2. Kalibrasi mesin HD\r\n3. Penggantian media pre-treatment\r\n4. Perbaikan mesin HD-RO skala berat / besar', 2, '2020-07-20 03:33:33', '2020-07-20 03:33:33'),
(1484, 57, 'Rasio untuk instalasi / kalibrasi', 5, '2020-07-20', 'Yang melakukan adalah TS', '1. Instalasi RO baru dilakukan oleh 2 orang selama 2-3 hari\r\n\r\n2. Reinstalasi / Pindah ruang HD-RO dilakukan 2 orang selama 2 hari, 1 malam\r\n\r\n3. Instalasi Mesin HD baru dilakukan oleh 1 orang, maximal 5 mesin HD, selama 1 hari. 10 mesin HD dilakukan oleh 2 orang selama 1 hari\r\n\r\n3. Kalibrasi Mesin HD, idem dengan instalasi meisn HD baru\r\n\r\n4. Penambahan hari / penambahan orang bisa dilakukan jika ada kasus khusus', 2, '2020-07-20 03:33:33', '2020-07-20 03:33:33'),
