(1692, 11, 'RSUD KOTA MADIUN ada kesalahan bayar ke Bank Jatim PT SRU pada tgl 17 April 2020 sebesar Rp 1.846.875, pihak Keuangan RSUD minta uang tersebut di kembalikan ke rek RSUD.\r\nPihak RSUD juga sudah memberikan surat pernyataan jika ada kesalahan transfer.', 11, '2020-06-22', 'Tgl 22/06/2020 dana tersebut sudah di kasir PT SRU dan segera di transfer ke RSUD KOTA MADIUN.\r\nTgl 22/06/2020 siang sudah di transfer ke rek RSUD KOTA MADIUN.', 'Surat pernyataan salah transfer dari pihak RSUD sudah di lampirkan ke kantor pusat untuk penarikan dana tersebut.', 2, '2020-08-19 03:42:39', '2020-08-19 03:42:39'),
(1693, 11, 'Ada pembayaran th 2019 yang masih menggantung di Kantor Pusat sebesar Rp 197.777.250 dengan keterangan Dinoyo Malang.', 11, '2020-06-30', 'Tgl 09/06/20 KA Keuangan RS UNIVERSITAS MUHAMMADIYAH sudah membuatkan surat pernyataan jika transfer tsb benar dari RSUM dan untuk kelebihan bayar tsb di kompensasikan ke tagihan berikutnya.\r\nTgl 10/06/20 surat pernyataan dan bukti transfer sudah di email ke kantor pusat.\r\nTgl 23/06/20 Kantor pusat sudah melakukan proses kompensasi dan pelunasan untuk faktur berikutnya.', 'Ini ketahui karena adanya transfer dengan keterangan yang sama pada tgl 13/04/20 BCA Rp. 59.303.750 Dinoyo Malang dan setelah dicocokkan nominal tagihan tersebut sama dengan no faktur RS UNIVERSITAS MUHAMMADIYAH PSI 2003-0963, setelah dikonfirmasi ke Pak Vicky (bendahara keuangan) memang benar transfer tersebut dari RS UNIVERSITAS MUHAMMADIYAH.\r\n\r\nPada tgl 09/06/20 saya menghadap ke Bu Luki Marthadhiana (KA Keuangan) untuk konfirmasi prihal pembayaran tahun 2019 dengan keterangan Dinoyo Malang, setelah dilakukan pengecekan dipembukuan pembayaran tahun 2019 memang benar 4 kali transfer tersebut dari RS UNIVERSITAS MUHAMMADIYAH dan pihak KA Keuangan juga menunjukkan bukti setoran BCA yang asli.\r\n\r\nBu Luki Marthadhiana (KA Keuangan) menerbitkan surat agar kelebihan bayar tsb di kompensasikan ke pembayaran faktur berikutnya', 2, '2020-08-19 03:42:39', '2020-08-19 03:42:39'),
(1694, 11, 'RSUD DR. ISKAK TULUNGAGUNG, PSI-2001-1458, 2020-01-17, pihak keuangan RS bayar sebesar RP 674.418.\r\nJadi harus minta ID Billing untuk melunaskan ppn Rp 61.311', 11, '2020-06-25', 'Pihak Keuangan blm bisa memberikan ID billing.\r\nTax Cab Surabaya sudah minta ID Billing ke kantor pusat.\r\nTunggu pembayaran dari accounting Cab Sby.', 'Follow up Keuangan', 2, '2020-08-19 03:42:39', '2020-08-19 03:42:39'),
