(1734, 78, 'Untuk tagihan rata2 Dinkes menggunakan anggaran DAK dan belum ada realisasi pembayaran sampai bulan Agustus 2020', 11, '2020-09-10', '* Sudah melakukan follow up secara rutin ke semua Dinkes untuk realisasi pembayaran.\r\n* Untuk Dinkes Sumenep yang piutangnya sebesar 1 miliar sudah dikirim surat permohonan pembayaran ke Kepala Dinkes.', '* Untuk realisasi pembayaran mundur karena sistem pengajuan dana ( sistem OMSPAM ) ke Kementrian Keuangan baru bisa di lakukan tgl 24 Juli 2020.\r\n* Pembayaran bisa direalisasikan jika semua rekanan yang masuk dalam pembayaran anggaran DAK sudah menyelesaikan administratif seperti berkas dan pengiriman.', 1, '2020-08-25 09:05:10', '2020-08-25 09:05:10'),
(1735, 78, 'SPK RSUD Dr. H. SLAMET MARTODIRDJO - PAMEKASAN sebesar Rp 1.007.820.000 sudah habis dan untuk pembuatan SPK ke 2 nya masih menunggu anggaran PAK th 2020.', 11, '2020-10-15', '* Sudah menghadap ke PPTK, PPK dan WADIR untuk membicarakan SPK yang anggarannya sudah habis. \r\n* Pihak RS dan atas nama Direktur RSUD PAMEKASAN minta untuk PT SRU tetap bersedia mengirimkan alkes HD sesuai dengan surat pesanan (SP).', '* Untuk penerbitan faktur bisa dilakukan setelah anggaran PAK tahun 2020 di sahkan dan kontrak ke 2 antara RSUD PAMEKASAN dengan PT SRU sudah dibuatkan.', 1, '2020-08-25 09:05:10', '2020-08-25 09:05:10'),
(1736, 78, 'RSUD SOEGIRI - LAMONGAN pada tgl 18/08/20 ada kesalahan transfer ke PT SRU sebesar Rp 353.400.000.', 11, '2020-09-04', '* Konfirmasi ke Keuangan untuk membuatkan surat pemberitahuan ada kesalahan transfer ke PT SRU.', '* Surat pernyataan sudah dibuatkan oleh pihak Keuangan RSUD SOEGIRI', 1, '2020-08-25 09:05:10', '2020-08-25 09:05:10'),
