(1753, 83, 'Evaluasi Mingguan KA Teknisi Okta Wirawan', 5, '2020-08-28', '-', '- RS William Booth keluhan air baku kotor, FU ke RS untuk melakukan perbaikan pada kualitas air baku yang digunakan\r\n- RS Panti Waluya Ma;ang, baterai backup mesin HD sudah digantikan dengan aki kering & akna dilakukan pengajuan regenerasi mesin HD\r\n- RSSA akan tarik 2 unit mesin HD yang rusak\r\n- RSUD Gambiran Kediri 1 unit mesin HD pada IO Board, belum ada datang sparepart\r\n- RSM Ahmad Dahlan Kediri tanya kapan akan dilakukan penarikan mesin regenerasi  sebanyak 1 unit', 1, '2020-08-31 01:51:58', '2020-08-31 01:51:58'),
(1754, 83, 'Evaluasi Mingguan KA Teknisi Heru Darmawan', 5, '2020-08-28', '-', '-RSUD Soetomo menunggu keputusan & jawaban mengenai masalah RIK\r\n- RSI Jemursari rusak 1 unit meisn HD pada IO Board\r\n- RSUD Soedono ada rusak 2 unit mesin HD\r\n- RSUD Soegiri Lamongan menunggu jadwal pindah ruangan dan jumlah kebutuhan listrik di ruang yang baru', 1, '2020-08-31 01:51:58', '2020-08-31 01:51:58'),
(1755, 83, 'Alur Permintaan Sparepart di Aplikasi TAM', 5, '2020-08-31', '-', 'Belum ada alur yang jelas mengenai alur pada permintaan sparepart di aplikasi TAM', 1, '2020-08-31 01:51:58', '2020-08-31 01:51:58'),
(1756, 83, 'SJ yang dibawa teknisi kurang pengontrolan oleh KA Teknisi', 5, '2020-08-31', '-', 'SJ yang dibawa oleh teknisi kurang di kontrol oleh KA Teknisi sehingga ada kasus, SJ belum balik padahal teknisi telah melakukan kunjungan', 2, '2020-08-31 01:51:58', '2020-08-31 01:51:58'),
