(1758, 83, 'Kerusakan pada mesin HD setelah dilakukan kalibrasi', 5, '2020-08-31', '-', 'Jika mesin mengalami kerusakan setelah dilakukan kalibrasi maka TS yg mengkalibrasi RS tsb ewajib untuk kembali melakukan perbaikan dengan biaya sendiri', 1, '2020-08-31 01:51:58', '2020-08-31 01:51:58'),
